import { MyPokemon } from "./MyPokemonData";
import react, { useState } from "react";

const MyNewPokemon = () => {
  const [pokemon1, setPokemon1] = useState(false);
  const [pokemon2, setPokemon2] = useState(false);
  const [pokemon3, setPokemon3] = useState(false);
  const [pokemon4, setPokemon4] = useState(false);

  const ShowPokemon1 = () => {
    setPokemon2(false);
    setPokemon3(false);
    setPokemon4(false);


    setPokemon1(true);
  };
  const ShowPokemon2 = () => {
    setPokemon1(false);
    setPokemon3(false);
    setPokemon4(false);
    setPokemon2(true);
  };
  const ShowPokemon3 = () => {
    setPokemon1(false);
    setPokemon2(false);
    setPokemon4(false);
    setPokemon3(true);
  };
  const ShowPokemon4 = () => {
    setPokemon1(false);
    setPokemon2(false);
    setPokemon3(false);
    setPokemon4(true);
  };
  return (
    <div>
      {/* <button onClick={ShowPokemon1>}Pikachu</button> */}
      
      <center>  <h1>My pokeballs</h1> 
      <img onClick={ShowPokemon1} src="data:image/jpeg;base64,"></img>
      <img onClick={ShowPokemon2} src="data:image/jpeg;base64,"></img>
      <img onClick={ShowPokemon3} src="data:image/jpeg;base64,"></img>
      <img onClick={ShowPokemon4} src="data:image/jpeg;base64,"></img>
      


      {/* <button onClick={ShowPokemon2}>Charmander</button>
      <button onClick={ShowPokemon3}>Ditto</button>
      <button onClick={ShowPokemon4}>Bulbasaur</button> */}

      {pokemon1 ? (
        <div>
          {MyPokemon[0].name} <img src={`${MyPokemon[0].image}`}></img>
        </div>
      ) : (
        ""
      )}
      {pokemon2 ? (
        <div>
          {MyPokemon[1].name} <img src={`${MyPokemon[1].image}`}></img>
        </div>
      ) : (
        ""
      )}
      {pokemon3 ? (
        <div>
          {MyPokemon[2].name} <img src={`${MyPokemon[2].image}`}></img>
        </div>
      ) : (
        ""
      )}
      {pokemon4 ? (
        <div>
          {MyPokemon[3].name} <img src={`${MyPokemon[3].image}`}></img>
        </div>
      ) : (
        ""
      )}

</center>


{/* 
      {MyPokemon.map((data) => {
        return (
          <div key={data.id}>
            <h1>{data.name}</h1>
            <img src={`${data.image}`} alt="image"></img>
            <img></img>
          </div>
        );
      })} */}
    </div>
  );
};

export default MyNewPokemon;
